def get_compatible(category=None, min_score=70):
    r = []
    for c, ss in SKILL_REGISTRY.items():
        if category and c != category: continue
        r.extend([s for s in ss if s["score"] >= min_score])
    return r

def search(query, min_score=0):
    q = query.lower()
    r = []
    for c, ss in SKILL_REGISTRY.items():
        for s in ss:
            if q in s["name"].lower() and s["score"] >= min_score:
                r.append({**s, "category": c})
    return sorted(r, key=lambda x: -x["score"])
